  false,\n\t\"url\": null,\n\t\"notes\": \"Illinois 2000-2015 STD gonorrhea counts
  by county by race/ethnicity. See attachment for metadata and censoring details under
  the \"About\" link.  Null values in dataset reflect censored data.  {AIAN: American
  Indian, Alaskan Native, non-Hispanic; Asian: Asian, non-Hispanic; Black: Black or
  African American, non-Hispanic; Hisp: Hispanc (of any race); MultiRace: more than
  one race was reported, non-Hispanic (Chlamydia and gonorrhea use multiple races
  in reporting, syphilis cases use single race reporting (i.e., MultiRace values may
  be zero for syphilis cases)); NHPI: Native Hawaiian or Other Pacific Islander (Chlamydia
  and gonorrhea cases reports distinguishes NHPI from Asians, whereas syphilis cases
  group Asians, native Hawaiians and other Pacific Islanders as u201cAsianu201d (i.e.,
  NHPI cases in syphilis case reports may display zero cases; these cases would have
  been reported under Asian)); White: White or Caucasian, non-Hispanic; Other: Other
  race, non-Hispanic; Unk: Unknown race, ethnicity.}  Data Source: Illinois Department
  of Public Health STD Program.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
